export function IconButton({ Icon, isActive, color, children, ...props }) {
    return (
        <button className={`btn icon-btn ${isActive ? "icon-btn-active" : ""} ${color || ""}`}
            {...props}>
            <span className={`${children != null ? "mr-1" : ""}`}>
                <Icon />
            </span>
            {children}
        </button>
    )
}
